import React from 'react'

const Home = (props) => {
    console.log(props)
    const headerStyle={
        margin: "30px auto 10px",
        fontWeight:'bold',
        fontSize:'40px',
        textDecoration:'underline' 
        
    }
    const go=()=>{
        props.history.push({pathname:'/game',state:{...props.location.state,state1:'this is 1'}})
    }
    return (
        <div className="App">
            <button onClick={go}>to game</button>
            <h1 className="center" style={headerStyle}>
                Tic-Tac-Toe   <span className="glyphicon glyphicon-play-circle"></span>
            </h1>
            <br/>
            <p style={{fontSize}}>Play Online With Friends</p>
        </div>
    )
}

export default Home
